I’m not going to lie, it’s really Hard to take a chance on yourself…. We all struggle with self doubt.  After training today I sat down and had a good 1min cry then I got back up and told myself that I’m doing everything in my power to be ready for what’s to come. 

If it makes you nervous it’s probably worth it ❤️‍🔥

@crossfitgames @tyrsport #crossfitgames #gettingready #partoftheprocess #mom

