What a weekend!!! I only got to take the floor once myself but ohhh it felt good. Then I got to step in a different seat, commentating and seeing the best battling it out!! Did I miss it?  yes Did I enjoy watching? of course I did! 

💥Highlights, not necessarily in any particular order this. 

The boys sliding down the hill together in the rain 

@dellespeegle flying over the logs and that slid under 😮‍💨👌

@tiaclair1 and @laurahorvaht battling it out this weekend WOW!! Big congratulations to Laura with her win showing just how incredibly strong and good she is at competing.  And Tia, No words for what she just did this weekend …. Absolutely insane!  Doing the impossible yet again. I am mind blown 🔥❤️

Thank you @roguefitness for an incredible event, weathering the storm better then anybody 🌧️

Who did it better?? 😜

